import React from "react";

export default function Decks({data}){

  const decks =  data.map((deck,index)=>{
        return (
            <div key = {index}>
                <div>
                    <h3>{deck.name}</h3>
                    <p> number of cards! </p>
                </div>
                <div>
                    <p>{deck.description}</p>
                </div>
                <div>
                    <button>View</button>
                    <button>Study</button>
                    <button>Delete</button>

                </div>
            </div>
        )
    })

    return (
        <div>
            <button>Create Deck</button>
            {decks}
        </div>
    )
}
